20//\x20G\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20=\x201\x20/\x20(1\x20+\x20lambda_v\x20+\x20lambda_l);\x0d\x0a\x0d\x0a\x09//\x20scientific\x20code\x20implement:\x0d\x0a\x09//\x20Reorder\x20code\x20to\x20be\x20more\x20optimal\x0d\x0a\x20\x20\x20\x20//\x20half\x20a\x20\x20\x20\x20\x20\x20\x20\x20\x20\x20=\x20roughness;\x0d\x0a\x20\x20\x20\x20//\x20half\x20a2\x20\x20\x20\x20\x20\x20\x20\x20\x20=\x20a\x20*\x20a;\x0d\x0a\x0d\x0a\x20\x20\x20\x20//\x20half\x20lambdaV\x20\x20\x20\x20=\x20NdotL\x20*\x20sqrt((-NdotV\x20*\x20a2\x20+\x20NdotV)\x20*\x20NdotV\x20+\x20a2);\x0d\x0a\x20\x20\x20\x20//\x20half\x20lambdaL\x20\x20\x20\x20=\x20NdotV\x20*\x20sqrt((-NdotL\x20*\x20a2\x20+\x20NdotL)\x20*\x20NdotL\x20+\x20a2);\x0d\x0a\x0d\x0a\x20\x20\x20\x20//\x20Simplify\x20visibility\x20term:\x20(2.0f\x20*\x20NdotL\x20*\x20NdotV)\x20/\x20\x20((4.0f\x20*\x20NdotL\x20*\x20NdotV)\x20*\x20(lambda_v\x20+\x20lambda_l\x20+\x201e-5f));\x0d\x0a\x20\x20\x20\x20//\x20return\x200.5f\x20/\x20(lambdaV\x20+\x20lambdaL\x20+\x201e-5f);\x20\x20\x0d\x0a\x09//\x20This\x20function\x20is\x20not\x20intended\x20to\x20be\x20running\x20on\x20Mobile,therefore\x20epsilon\x20is\x20smaller\x20than\x20can\x20be\x20represented\x20by\x20half\x0d\x0a\x0d\x0a\x09//\x20Approximation\x20of\x20the\x20above\x20formulation\x20(simplify\x20the\x20sqrt,\x20not\x20mathematically\x20correct\x20but\x20close\x20enough)\x0d\x0a\x09float\x20a\x20=\x20roughness;\x0d\x0a\x09float\x20lambdaV\x20=\x20NdotL\x20*\x20(NdotV\x20*\x20(1.0\x20-\x20a)\x20+\x20a);\x0d\x0a\x09float\x20lambdaL\x20=\x20NdotV\x20*\x20(NdotL\x20*\x20(1.0\x20-\x20a)\x20+\x20a);\x0d\x0a\x09return\x200.5\x20/\x20(lambdaV\x20+\x20lambdaL\x20+\x201e-5);\x0d\x0a}\x0d\x0a\x0d\x0afloat\x20ggxTerm(float\x20NdotH,\x20float\x20roughness)\x0d\x0a{\x0d\x0a\x09float\x20a2\x20=\x20roughness\x20*\x20roughness;\x0d\x0a\x09float\x20d\x20=\x20(NdotH\x20*\x20a2\x20-\x20NdotH)\x20*\x20NdotH\x20+\x201.0;\x20//\x202\x20mad\x0d\x0a\x09return\x20INV_PI\x20*\x20a2\x20/\x20(d\x20*\x20d\x20+\x201e-7);\x20//\x20This\x20function\x20is\x20not\x20intended\x20to\x20be\x20running\x20on\x20Mobile,therefore\x20epsilon\x20is\x20smaller\x20than\x20what\x20can\x20be\x20represented\x20by\x20half//返回值小用half来返回\x0d\x0a}\x0d\x0a\x0d\x0a//\x20BRDF1-------------------------------------------------------------------------------------\x0d\x0a\x0d\x0a//\x20Note:\x20BRDF\x20entry\x20points\x20use\x20smoothness\x20and\x20oneMinusReflectivity\x20for\x20optimization\x20purposes,\x0d\x0a//\x20mostly\x20for\x20DX9\x20SM2.0\x20level.\x20Most\x20of\x20the\x20math\x20is\x20being\x20done\x20on\x20these\x20(1-x)\x20values,\x20and\x20that\x20saves\x20a\x20few\x20precious\x20ALU\x20slots.\x0d\x0a\x0d\x0a//\x20Main\x20Physically\x20Based\x20BRDF\x0d\x0a//\x20Derived\x20from\x20Disney\x20work\x20and\x20based\x20on\x20Torrance-Sparrow\x20micro-facet\x20model\x0d\x0a//\x0d\x0a//\x20BRDF\x20=\x20kD\x20/\x20pi\x20+\x20kS\x20*\x20(D\x20*\x20V\x20*\x20F)\x20/\x204\x0d\x0a//\x20I\x20=\x20BRDF\x20*\x20NdotL\x0d\x0a//\x0d\x0a//\x20*NDF\x20GGX:\x0d\x0a//\x20*Smith\x20for\x20Visiblity\x20term\x0d\x0a//\x20*Schlick\x20approximation\x20for\x20Fresnel\x0d\x0amediump\x20vec4\x20layaBRDFHighLight(mediump\x20vec3\x20diffColor,\x20mediump\x20vec3\x20specColor,\x20mediump\x20float\x20oneMinusReflectivity,\x20float\x20perceptualRoughness,float\x20roughness,mediump\x20float\x20nv,vec3\x20normal,\x20vec3\x20viewDir,LayaLight\x20light)\x0d\x0a{\x0d\x0a\x09vec3\x20halfDir\x20=\x20safeNormalize(viewDir-light.dir);\x0d\x0a\x0d\x0a\x09float\x20nl\x20=\x20clamp(dot(normal,\x20-light.dir),0.0,1.0);\x0d\x0a\x09float\x20nh\x20=\x20clamp(dot(normal,\x20halfDir),0.0,1.0);\x0d\x0a\x09mediump\x20float\x20lv\x20=\x20clamp(dot(light.dir,\x20viewDir),0.0,1.0);\x0d\x0a\x09mediump\x20float\x20lh\x20=\x20clamp(dot(light.dir,\x20-halfDir),0.0,1.0);\x0d\x0a\x0d\x0a\x09//\x20Diffuse\x20term\x0d\x0a\x09mediump\x20float\x20diffuseTerm\x20=\x20disneyDiffuse(nv,\x20nl,\x20lh,\x20perceptualRoughness)\x20*\x20nl;\x0d\x0a\x0d\x0a\x09//\x20Specular\x20term\x0d\x0a\x20\x20\x20\x20//\x20HACK:\x20theoretically\x20we\x20should\x20divide\x20diffuseTerm\x20by\x20Pi\x20and\x20not\x20multiply\x20specularTerm!\x0d\x0a\x20\x20\x20\x20//\x20BUT\x20that\x20will\x20make\x20shader\x20look\x20significantly\x20darker\x20than\x20Legacy\x20ones\x0d\x0a\x0d\x0a\x09//\x20GGX\x20with\x20roughtness\x20to\x200\x20would\x20mean\x20no\x20specular\x20at\x20all,\x20using\x20max(roughness,\x200.002)\x20here\x20to\x20match\x20HDrenderloop\x20roughtness\x20remapping.\x0d\x0a\x09roughness\x20=\x20max(roughness,\x200.002);\x0d\x0a\x09float\x20V\x20=\x20smithJointGGXVisibilityTerm(nl,\x20nv,\x20roughness);\x0d\x0a\x09float\x20D\x20=\x20ggxTerm(nh,\x20roughness);\x0d\x0a\x0d\x0a\x09float\x20specularTerm\x20=\x20V\x20*\x20D\x20*\x20PI;\x20//\x20Torrance-Sparrow\x20model,\x20Fresnel\x20is\x20applied\x20later\x0d\x0a\x0d\x0a\x09//#ifdef\x20LAYA_COLORSPACE_GAMMA\x0d\x0a\x09specularTerm\x20=\x20sqrt(max(1e-4,\x20specularTerm));\x0d\x0a\x09//#endif\x0d\x0a\x09specularTerm\x20=\x20max(0.0,\x20specularTerm\x20*\x20nl);\x0d\x0a\x09\x09\x0d\x0a\x09mediump\x20vec3\x20color\x20=\x20diffColor\x20*\x20light.color\x20*\x20diffuseTerm\x20+\x20specularTerm\x20*\x20light.color\x20*\x20fresnelTerm(specColor,\x20lh);\x0d\x0a\x09return\x20vec4(color,\x201.0);\x0d\x0a}\x0d\x0a\x0d\x0avec4\x20layaBRDFHighGI(mediump\x20vec3\x20diffColor,mediump\x20vec3\x20specColor,mediump\x20float\x20oneMinusReflectivity,float\x20smoothness\x20,float\x20perceptualRoughness,float\x20roughness,mediump\x20float\x20nv,vec3\x20normal,\x20vec3\x20viewDir,LayaGI\x20gi)\x0d\x0a{\x0d\x0a\x09//\x20surfaceReduction\x20=\x20Int\x20D(NdotH)\x20*\x20NdotH\x20*\x20Id(NdotL>0)\x20dH\x20=\x201/(roughness^2+1)\x0d\x0a\x09float\x20surfaceReduction;\x0d\x0a\x09surfaceReduction\x20=\x201.0\x20-\x200.28*roughness*perceptualRoughness;//\x201-0.28*x^3\x20as\x20approximation\x20for\x20(1/(x^4+1))^(1/2.2)\x20on\x20the\x20domain\x20[0;1]\x0d\x0a\x09float\x20grazingTerm\x20=\x20clamp(smoothness\x20+\x